import React, { Component } from "react";
import TempChart from '../../components/tempList/tempList.js';

class TroopDashboard extends Component {
    render(){
        return(
            <div>
                <TempChart weatherData={this.props.forecastPeriods}/>
            </div>
        )
    }
}

export default TroopDashboard;
